import React from 'react'
import Card from "./components/Card";

export default function Discover({movies}) {
  return (
    <div>
        <h3>Latest & Trending</h3>
        <div>
          {movies &&
            movies.map((movie,index) => (
              <Card movie={movie}/>
            ))}
        </div>
      </div>
  )
}
